define("logiMRApi",function(require,exports,module){var lib=require("lib");var form=require("form");var M={loginQQ:function(){var fromUrl=lib.getParam("fromUrl")||document.location.href;var url=lib.url+"qq/login?url="+encodeURIComponent(fromUrl);lib.post(url,function(objResult){if(!objResult.result){if(objResult.data){document.location.replace(objResult.data)}else{lib.showTip(objResult.msg)}}else{document.location.replace(fromUrl)}},{loading:true})},loginWeibo:function(){var fromUrl=lib.getParam("fromUrl")||document.location.href;var url=lib.url+"weibo/login?url="+encodeURIComponent(fromUrl);lib.post(url,function(objResult){if(!objResult.result){if(objResult.data){document.location.replace(objResult.data)}else{lib.showTip(objResult.msg)}}else{document.location.replace(fromUrl)}},{loading:true})},loginWx:function(){var fromUrl=lib.getParam("fromUrl")||document.location.href;var url=lib.url+"weixin/login?url="+encodeURIComponent(fromUrl);lib.post(url,function(objResult){if(!objResult.result){if(objResult.data){document.location.href=objResult.data}else{lib.showTip(objResult.msg)}}else{document.location.href=fromUrl}},{loading:true})}};exports.loginQQ=M.loginQQ;exports.loginWeibo=M.loginWeibo;exports.loginWx=M.loginWx});
